// Add a ?q=searchterm query string to a URL.
suitehelp.addQueryStringToURL = function (url, key, value) {
    "use strict";

    if (url.match(/\?/)) {
        url += "&";
    } else {
        url += "?";
    }

    return url + escape(key) + "=" + escape(value);
};

