suitehelp.resetLayout = function () {
    "use strict";
    var leftbar = $("#leftbar").width();
    $("#center").css("left", leftbar);
    $(".holdsearch").width(leftbar - 45);
    $(".submit").css("left", (leftbar - 45));
    $("nav.toc nav").width(leftbar);
    suitehelp.resizeSearchWidth = leftbar - 75;
    $("#breadcrumbs").css("left", (leftbar + 90));
    $(".navigation").css("left", (leftbar + 30));
};
suitehelp.resetScrollBars = function (selector) {
    "use strict";
    return $(selector).jScrollPane({
        autoReinitialise: true,
	       showArrows: true,
		   horizontalGutter: 30,
		   verticalGutter: 30,
		   mouseWheelSpeed: 50
	});
};
function whLoad(init) {
    if (init) {
        suitehelp.centerScroll = suitehelp.resetScrollBars('#scroller');
        suitehelp.searchScroll =  suitehelp.resetScrollBars('#leftbar nav.search nav.results');
        suitehelp.tocScroll =   suitehelp.resetScrollBars('#leftbar nav.toc');
        $("#searchform .search").prop("placeholder", "Search");        
        $("#search-toc-link").click(function (){
            $("#leftbar nav").removeClass("current");
            $("#leftbar nav.toc").addClass("current");
            $(".tabs a").removeClass("current");
            $(".tabs .toc").addClass("current");
            suitehelp.breadcrumbs();
            return false;
        });        
        suitehelp.resetLayout();

    }
}

suitehelp.customizeRootBreadCrumb = true;
suitehelp.andSearch = true;
suitehelp.customScrollBar = true;
suitehelp.breadcrumbGraphic = true;
suitehelp.rtl = false;
